import React from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';

const Container = styled.div`
  background-color: #fff;
  display: flex;
  flex-direction: column;
  align-items: stretch;
`;

const MainContent = styled.div`
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: center;
  padding: 21px 0;
`;

const ShippingSection = styled.div`
  width: 100%;
  max-width: 80%;
  margin: 0 10%;
  display: flex;
  flex-direction: column;
  
  @media (max-width: 991px) {
    max-width: 100%;
    margin: 0 5%;
  }
`;

const ShippingTitle = styled.h1`
  color: #000;
  margin-top: 109px;
  font: 700 25px Open Sans, sans-serif;
`;

const ShippingForm = styled.form`
  display: flex;
  flex-direction: column;
  gap: 20px;
  margin-top: 30px;
`;

const FormGroup = styled.div`
  display: flex;
  flex-direction: column;
  gap: 10px;
`;

const Label = styled.label`
  font: 500 15px Open Sans, sans-serif;
  color: #000;
`;

const Input = styled.input`
  padding: 15px;
  border: 1px solid #e4e4e4;
  border-radius: 10px;
  font: 400 14px Open Sans, sans-serif;
  width: 100%;
  max-width: 600px;
`;

const ShippingMethodsContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 20px;
  width: 100%;
  max-width: 600px;
  margin: 40px 0;
`;

const ShippingMethod = styled.div`
  border-radius: 10px;
  background-color: #fff;
  padding: 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  cursor: pointer;
  transition: all 0.3s ease;
  border: 1px solid #e4e4e4;

  &:hover {
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  }
`;

const MethodInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: 5px;
`;

const MethodName = styled.h3`
  font-size: 16px;
  margin: 0;
  font-family: Open Sans, sans-serif;
`;

const MethodDescription = styled.p`
  font-size: 14px;
  color: #666;
  font-weight: 400;
  margin: 0;
  font-family: Open Sans, sans-serif;
`;

const MethodPrice = styled.span`
  font-size: 18px;
  color: #0055b6;
  font-family: Open Sans, sans-serif;
  font-weight: 700;
`;

const ContinueButton = styled.button`
  border-radius: 30px;
  background-color: rgba(0, 85, 182, 1);
  text-align: center;
  font-size: 15px;
  color: #fff;
  border: none;
  padding: 19px 150px;
  cursor: pointer;
  align-self: flex-start;
  margin-bottom: 40px;

  @media (max-width: 991px) {
    padding: 15px 50px;
    align-self: center;
  }
`;

const ShippingDetails: React.FC = () => {
  const navigate = useNavigate();

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    navigate('/payment');
  };

  return (
    <Container>
      <MainContent>
        <Header />
        <ShippingSection>
          <ShippingTitle>Shipping Address</ShippingTitle>
          <ShippingForm onSubmit={handleSubmit}>
            <FormGroup>
              <Label>Full Name</Label>
              <Input type="text" placeholder="Enter your full name" required />
            </FormGroup>
            <FormGroup>
              <Label>Address Line 1</Label>
              <Input type="text" placeholder="Street address" required />
            </FormGroup>
            <FormGroup>
              <Label>Address Line 2</Label>
              <Input type="text" placeholder="Apartment, suite, etc. (optional)" />
            </FormGroup>
            <FormGroup>
              <Label>City</Label>
              <Input type="text" placeholder="Enter your city" required />
            </FormGroup>
            <FormGroup>
              <Label>State/Province</Label>
              <Input type="text" placeholder="Enter your state/province" required />
            </FormGroup>
            <FormGroup>
              <Label>ZIP/Postal Code</Label>
              <Input type="text" placeholder="Enter your ZIP/postal code" required />
            </FormGroup>
            <FormGroup>
              <Label>Phone Number</Label>
              <Input type="tel" placeholder="Enter your phone number" required />
            </FormGroup>

            <ShippingTitle>Select Shipping Method</ShippingTitle>
            <ShippingMethodsContainer>
              <ShippingMethod>
                <MethodInfo>
                  <MethodName>Standard Shipping</MethodName>
                  <MethodDescription>Delivery in 5-7 business days</MethodDescription>
                </MethodInfo>
                <MethodPrice>Free</MethodPrice>
              </ShippingMethod>
              <ShippingMethod>
                <MethodInfo>
                  <MethodName>Express Shipping</MethodName>
                  <MethodDescription>Delivery in 2-3 business days</MethodDescription>
                </MethodInfo>
                <MethodPrice>$15.00</MethodPrice>
              </ShippingMethod>
              <ShippingMethod>
                <MethodInfo>
                  <MethodName>Next Day Delivery</MethodName>
                  <MethodDescription>Delivery by tomorrow if ordered before 2 PM</MethodDescription>
                </MethodInfo>
                <MethodPrice>$25.00</MethodPrice>
              </ShippingMethod>
            </ShippingMethodsContainer>

            <ContinueButton type="submit">
              Continue to Payment
            </ContinueButton>
          </ShippingForm>
        </ShippingSection>
      </MainContent>
      <Footer />
    </Container>
  );
};

export default ShippingDetails;
